import React from 'react';
import NavBar from 'components/NavBar.js';
import { Container } from 'semantic-ui-react';

const About = () => {
    return (
        <div>
            <NavBar />

            <Container style={{ marginTop: '7em' }}>
                <h2>About</h2>
            </Container>
        </div>
    );
};

export default About;
